.site-nav .site-nav-menu-hover .site-nav-icon {
  color: var(--tbpc-primary-theme-color, #ff5000);
}
.site-nav .site-nav-bd-r .site-nav-icon {
  width: 20px;
}
.site-nav .site-nav-icon-highlight {
  color: var(--tbpc-primary-theme-color, #ff5000);
}
.site-nav .site-nav-arrow {
  display: block;
  float: left;
  width: 8px;
  height: 8px;
  line-height: 8px;
  overflow: hidden;
  margin-top: 14px;
}
.site-nav .site-nav-arrow .site-nav-icon {
  display: block;
  font-size: 16px;
  width: 16px;
  margin-top: 0;
  margin-right: 0;
  transform: scale(0.5);
  transform-origin: left;
}
.site-nav .site-nav-menu-hover .site-nav-arrow {
  transform: rotateZ(180deg);
  transition: transform 0.2s ease-in-out;
}
.site-nav {
  z-index: 10000;
  width: 100%;
  background-color: #fff;
  border-bottom: 1px solid transparent;
  *zoom: 1;
}
.site-nav:after {
  content: "";
  display: table;
  clear: both;
}
.site-nav textarea {
  display: none;
}

  margin: 0 auto;
  padding-left: 80px;
  padding-right: 80px;

  *zoom: 1;
}
.site-nav .site-nav-bd:after {
  content: "";
  display: table;
  clear: both;
}
.site-nav .site-nav-bd a {
  color: #1f1f1f;
}
.site-nav .site-nav-bd a:hover {
  color: var(--tbpc-primary-theme-color, #ff5000);
  text-decoration: none;
}
.site-nav .site-nav-bd .site-nav-pipe {
  padding: 0 12px;
  font-style: normal;
  color: #ddd;
}
.site-nav .site-nav-bd .site-nav-bd-l {
  float: left;
  visibility: hidden;
}
